					currentChanged = AggregateType_subs.parse(parser, t.aggregate);
					parser.parsePublishableStructEnd();
				}
				else if(addr.Length > offset + 1)
				{
					currentChanged = AggregateType_subs.parse(parser, t.aggregate, addr, offset + 1);
				}
				else
					throw new Exception();

				if(currentChanged)
				{
					changed = true;
