			if (value != t.basic)
			{
				t.basic = value;
				composer.composeAddress(address, (UInt64)Address.basic);
				composer.composePublishableStructBegin("value");
				BasicTypes_publ.compose(composer, value);
				composer.composePublishableStructEnd(false);
				composer.composePublishableStructEnd(false);
			}
		}
	}
